from py4godot.wrappers.wrappers import CPPResourceImporterSceneWrapper


class ResourceImporterScene(py4godot_resourceimporter.ResourceImporter):
  r'''
		See also `ResourceImporterOBJ`, which is used for OBJ models that can be imported as an independent `Mesh` or a scene.
		Additional options (such as extracting individual meshes or materials to files) are available in the **Advanced Import Settings** dialog. This dialog can be accessed by double-clicking a 3D scene in the FileSystem dock or by selecting a 3D scene in the FileSystem dock, going to the Import dock and choosing **Advanced**.
		**Note:** `ResourceImporterScene` is _not_ used for `PackedScene`s, such as `.tscn` and `.scn` files.
	'''

  @staticmethod
  def constructor():
    class_ = ResourceImporterScene.construct_without_init()
    class_._ptr = constructor(700,0, ())
    return class_
  @staticmethod
  def new():
    class_ = ResourceImporterScene.construct_without_init()
    class_._ptr = constructor(700,0, ())
    return class_
  def __init__(self):
    self._ptr =  CPPResourceImporterSceneWrapper()
    if c_utils.shouldCreateObject:
      self._ptr = constructor(700,0, ())


  def generate_wrapper(self):
    return CPPResourceImporterSceneWrapper()
  def init_signals(self):
    super().init_signals()

  @staticmethod
  def construct_without_init():
    cls = ResourceImporterScene.__new__(ResourceImporterScene)
    cls.shouldBeDeleted = True
    cls.init_signals()
    return cls
  @staticmethod
  def get_type():
    return 'ResourceImporterScene'

  def __del__(self):
    pass
  @staticmethod
  def cast(other:'Object'):
    assert other != None # Object to be casted must not be None
    cls = ResourceImporterScene.construct_without_init()
    cls._ptr = CPPResourceImporterSceneWrapper()
    cls._ptr_before = other._ptr # Save pointer
    cls._ptr.copy_gdowner(cls._ptr_before)
    cls.casted_from = other
    return cls
  @staticmethod
  def cast_without_reference(other: 'Object'):
    assert other != None # Object to be casted must not be None
    cls = ResourceImporterScene.construct_without_init()
    cls._ptr = CPPResourceImporterSceneWrapper()
    cls._ptr_before = other._ptr # Save pointer
    cls._ptr.copy_gdowner(cls._ptr_before)
    return cls


register_cast_function('ResourceImporterScene', ResourceImporterScene.cast)
register_class('ResourceImporterScene', ResourceImporterScene)
